import ExpenseItem from "./ExpenseItem";

export default function ExpenseList(props){

    const expenseItems = props.expenses.map(item=> {
        return <ExpenseItem date={props.date}
                            name={props.name}
                            cost={props.cost}
                            key={props.id}
                            />;
    })

    return (
        <>
            {expenseItems}
        </>
    )
}
